import React, { Component } from 'react';


class Main extends Component {
    render() {
        return (
            <div>
               <h2>Log in</h2> 
               <p><a href ='http://localhost:4000/auth/steam'>Sign on</a></p>
               <p><a href ='http://localhost:4000/logout'>Logout</a></p>
            </div>
        )
    }
}

export default Main
